import React from 'react';
import Home from './Home';
import About from './About';
import{Route,BrowserRouter as Router,Switch} from "react-router-dom";

function App() {
  return (  
   <Router>
     <div>hi</div>

      <Route path="/" componet={Home}/>
      <Route path="/About" componetAbout />
      </Router>  
  );
}

export default App;
